    return (
    <div className="signin">
        <div className="container">
            <h2 className="title">
                {props.title}
            </h2>
            <p className="text">
                {props.text1} <br/>
                {props.text2}
            </p>
            <button className='button'>SignIn</button>
        </div>
    </div>
    )

}
